import styled from "styled-components"

export const Title = styled.Text`
    position: relative;
    left: 134px;
    top: 44px;
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
`;

export const Cabecalho = styled.div`
    background: red;
    height: 64px;

`;
